(635171, 'Unknown', NULL, 5023, 638404),
(635181, 'Unknown', NULL, 5023, 638414),
(635191, 'For anyone that is interested in any of these professions, they will have to research community colleges, trade schools, and 4 year schools in their area. Depending on the program, some may take only 18 – 24 months, while other will require 4 years for completion. The best advice is to speak with advisors and representatives at colleges to see if they offer these programs and find out about the admission process. Some programs, such as Respiratory therapy and RN, may require a student to pass an exam and apply for the program after they complete prerequisites.', NULL, 5023, 638424),
(635201, 'Unknown', NULL, 5023, 638434),
(635211, 'Unknown', NULL, 5023, 638444),
(635221, 'Unknown', NULL, 5023, 638454),
(635231, 'Unknown', NULL, 5023, 638464),
(635241, 'Depending on the choices, most require an employee to complete a degree program and obtain practicum through clinicals and internships. I would suggest speaking with a current professional, especially since the global economy changed the nature of many of these careers. For an example, biotechnology will be incorporated in healthcare careers. http://www.bls.gov/ooh/ is a great website that provides basic information about the growth of industries, how to enter the field, degree requirement, and potential work environment. Also, almost every field has national and international associations where they can network with professionals in their chosen field so they can educate an interested about how to enter the field of their choice.', NULL, 5023, 638474),
(635251, 'Unknown', NULL, 5023, 638484),
(635261, 'Depends on the employer and the location of the job. Northeast and Midwest has a stronger union presence than the south. Also, public institutions will more likely require employees to join unions.', NULL, 5023, 638494),
(635271, 'Unknown', NULL, 5023, 638504),
(635281, 'Unknown', NULL, 5023, 638514),
(635291, 'Unknown', NULL, 5023, 638524),
(635301, 'Unknown', NULL, 5023, 638534),
(635311, 'Unknown', NULL, 5023, 638544),
(635321, 'Unknown', NULL, 5023, 638554),
(635331, 'Unknown', NULL, 5023, 638564),
(635341, 'Unknown', NULL, 5023, 638574),
(635351, 'Unknown', NULL, 5023, 638584),
(635361, 'Unknown', NULL, 5023, 638594),
(635371, 'Unknown', NULL, 5023, 638604),
(635381, 'Unknown', NULL, 5023, 638614),
(635391, 'Unknown', NULL, 5023, 638624),
(635401, 'Unknown', NULL, 5023, 638634),
(635411, 'Unknown', NULL, 5023, 638644),
(635421, 'Depends on the occupation. The most important skills are communication/writing skills, math/science in the health care field, critical thinking, customer service, teamwork, the ability to work independently, and computer skills. An interested candidate must attend post-secondary institutions to develop most of these skills.', NULL, 5023, 638654),
(635431, 'Unknown', NULL, 5023, 638664),
(635441, 'Unknown', NULL, 5023, 638674),
(635451, 'Contact school counselors about how immigration status will impact eligibility to attend post-secondary institutions and trade schools. Also, contact occupation boards, such as nursing and respiratory therapy to determine how immigration status impacts eligibility to receive licenses/certifications.', NULL, 5023, 638684),
(635461, 'Unknown', NULL, 5023, 638694),
(635471, 'Unknown', NULL, 5023, 638704),
(635481, 'Unknown', NULL, 5023, 638714),
(635491, 'Unknown', NULL, 5023, 638724),
(635501, 'Unknown', NULL, 5023, 638734),
(635511, 'Unknown', NULL, 5023, 638744),
(635521, 'Unknown', NULL, 5023, 638754),
(635531, 'Unknown', NULL, 5023, 638764),
(635541, 'Unknown', NULL, 5023, 638774),
(635551, 'Most hiring places are in larger/public institutions. Private institutions require fewer workers, therefore, interested candidates will have to pursue more creative networking strategies, such as attending social events, connecting with them on social networks, and attending conferences to meet with professionals with private practices and market their skills. The job market is about whom you know, so connecting with professionals on a social level will increase an applicant’s chance of obtaining employment. ', NULL, 5023, 638784),
