('Q386', '51-0000', '51-9121', 'Painting and coating workers paint and coat a wide range of products, including cars, jewelry, and ceramics.', 'Coating, Painting, and Spraying Machine Setters, Operators, and Tenders', 'Very Unfavorable', 10, 'High school diploma or equivalent', 'None', 'Moderate-term on-the-job training', 'High school', 340, 26870, 22610, 16880, 31870, 'Great', 1.71198, 3, 1, 0.00363636, 0.695692),
('Q386', '51-0000', '51-9123', 'Painting and coating workers paint and coat a wide range of products, including cars, jewelry, and ceramics.', 'Painting, Coating, and Decorating Workers', 'Very Unfavorable', 10, 'High school diploma or equivalent', 'None', 'Moderate-term on-the-job training', 'High school', 280, 36450, 36100, 20660, 44340, 'Premium', 1.97523, 3, 1, 0.00363636, 1.11077);
