INSERT INTO `occupations` (`Id`, `IndustryId`, `WorkExperienceId`, `EducationLevelId`, `Name`, `Code`, `Description`, `SocCode`, `MedianPayAnnual`, `MedianPayHourly`, `NumberOfJobs`, `EmploymentOpenings`) VALUES
(1, 2, 5, 5, 'Accountants and Auditors', 'P047', 'Accountants and auditors prepare and examine financial records. They ensure that financial records are accurate and that taxes are paid properly and on time. Accountants and auditors assess financial operations and work to help ensure that organizations run efficiently.', '132011', 61690.00, 29.66, 1216900, 190700),
(2, 9, 5, 3, 'Actors', 'P151', 'Actors express ideas and portray characters in theater, film, television, and other performing arts media. They also work at theme parks or for other live events. They interpret a writer’s script to entertain or inform an audience.', '272011', 0.00, 17.44, 66500, 2600),
(3, 3, 5, 5, 'Actuaries', 'P063', 'Actuaries analyze the financial costs of risk and uncertainty. They use mathematics, statistics, and financial theory to assess the risk that an event will occur and to help businesses and clients develop policies that minimize the cost of that risk.', '152011', 87650.00, 42.14, 21700, 5800),
(4, 1, 1, 2, 'Administrative Services Managers', 'P020', 'Administrative services managers plan, direct, and coordinate supportive services of an organization. Their specific responsibilities vary by the type of organization and may include keeping records, distributing mail, and planning and maintaining facilities.', '113011', 77890.00, 37.45, 254300, 36900),
(5, 8, 5, 5, 'Adult Literacy and GED Teachers', 'P136', 'Adult literacy and General Education Development (GED) teachers instruct adults and youths who are out of school in basic skills, such as reading, writing, and speaking English. They also help students earn their GED or high school diploma.', '253011', 46530.00, 22.37, 86900, 12700),
(6, 16, 5, 2, 'Advertising Sales Agents', 'P239', 'Advertising sales agents sell advertising space to businesses and individuals. They contact potential clients, make sales presentations, and maintain client accounts.', '413011', 45350.00, 2.18, 160400, 20900),
(7, 1, 1, 5, 'Advertising, Promotions, and Marketing Managers', 'P016', 'Advertising, promotions, and marketing managers plan programs to generate interest in a product or service. They work with art directors, sales agents, and financial staff members.', '112011', 108260.00, 52.05, 216800, 29400),
(8, 4, 5, 4, 'Aerospace Engineering and Operations Technicians', 'P334', 'Aerospace engineering and operations technicians operate and maintain equipment used in developing, testing, and producing new aircraft and spacecraft. Increasingly, they use computer-based modeling and simulation tools and processes in this work.', '173021', 58080.00, 27.93, 8700, 100),
(9, 4, 5, 5, 'Aerospace Engineers', 'P070', 'Aerospace engineers design aircraft, spacecraft, satellites, and missiles. In addition, they test prototypes to make sure that they function according to design.', '172011', 97480.00, 46.86, 81000, 4000),
(10, 5, 5, 4, 'Agricultural and Food Science Technicians', 'P342', 'Under the supervision of scientists, agricultural and food science technicians measure and analyze the quality of food and agricultural products.', '194011', 32760.00, 15.75, 21300, 1500),
(11, 5, 5, 9, 'Agricultural and Food Scientists', 'P090', 'Agricultural and food scientists work to ensure agricultural productivity and food safety.', '191011', 58450.00, 2.81, 33500, 3500),
(12, 4, 5, 5, 'Agricultural Engineers', 'P332', 'Agricultural engineers—also known as biological and agricultural engineers—work on a variety of activities. These activities range from aquaculture (raising food, such as fish, that thrive in water) to land farming to forestry; from developing biofuels to improving conservation; from planning animal environments to finding better ways to process food.', '172021', 71090.00, 34.18, 2700, 2001),
(13, 18, 4, 9, 'Agricultural Workers', 'P257', 'Agricultural workers maintain the quality of farms, crops, and livestock by operating machinery and doing physical labor under the supervision of agricultural managers.', '452021', 18970.00, 9.12, 757900, 20000),
(14, 22, 5, 4, 'Air Traffic Controllers', 'P312', 'Air traffic controllers coordinate the movement of air traffic to ensure that planes stay safe distances apart.', '532021', 108040.00, 51.94, 27000, 800),
(15, 20, 5, 8, 'Aircraft and Avionics Equipment Mechanics and Technicians', 'P280', 'Aircraft and avionics equipment mechanics and technicians repair and do scheduled maintenance on airplanes and helicopters. They also inspect airplanes and helicopters as required by the Federal Aviation Administration (FAA).', '492091', 53220.00, 25.59, 142300, 9100),
(16, 22, 4, 9, 'Airline and Commercial Pilots', 'P311', 'Airline and commercial pilots fly and navigate airplanes or helicopters. Airline pilots fly for airlines that transport people and cargo on a fixed schedule. Commercial pilots fly aircraft for other reasons, such as charter flights, rescue operations, firefighting, aerial photography, and crop dusting.', '532011', 92060.00, 0.00, 103500, 11500),
(17, 15, 5, 9, 'Animal Care and Service Workers', 'P227', 'Animal care and service workers care for the needs of animals. They feed, water, groom, bathe, and exercise pets and other nonfarm animals. Job tasks vary by position and place of work.', '392011', 19780.00, 9.51, 234900, 54000),
(18, 9, 5, 9, 'Announcers', 'P160', 'Announcers present music, news, and sports and may provide commentary or interview guests about these topics or other important events. Some act as a master of ceremonies (emcee) or disc jockey (DJ) at weddings, parties, or clubs.', '273011', 27010.00, 12.99, 61900, 4100),
(19, 5, 5, 6, 'Anthropologists and Archeologists', 'P108', 'Anthropologists and archeologists study the origin, development, and behavior of human beings, past and present. They examine the cultures, languages, archeological remains, and physical characteristics of people in various parts of the world.', '193091', 54230.00, 26.07, 6100, 1300),
(20, 2, 5, 2, 'Appraisers and Assessors of Real Estate', 'P048', 'Appraisers and assessors of real estate estimate the value of real property—land and the buildings on that land— before it is sold, mortgaged, taxed, insured, or developed.', '132021', 48500.00, 23.32, 77800, 5800),
(21, 4, 5, 5, 'Architects', 'P066', 'Architects plan and design buildings and other structures.', '171011', 72550.00, 34.88, 113700, 27900),
(22, 1, 3, 5, 'Architectural and Engineering Managers', 'P032', 'Architectural and engineering managers plan, coordinate, and direct activities in architecture and engineering, including research and development in these fields.', '119041', 119260.00, 57.34, 176800, 15200),
(23, 8, 5, 5, 'Archivists', 'P137', 'Archivists appraise, edit, and maintain permanent records and historically valuable documents. Many do research on archival material.', '254011', 45200.00, 21.73, 6100, 700),
(24, 9, 1, 5, 'Art Directors', 'P143', 'Art directors are responsible for the visual style and images in magazines, newspapers, product packaging, and movie and television productions. They create the overall design and direct others who develop artwork or layouts.', '271011', 80630.00, 38.77, 73900, 6700),
(25, 21, 5, 2, 'Assemblers and Fabricators', 'P293', 'Assemblers and fabricators assemble both finished products and the parts that go into them. They use tools, machines, and their hands to make engines, computers, aircraft, toys, electronic devices, and more.', '512011', 28360.00, 13.63, 1626500, 88000),
(26, 9, 5, 2, 'Athletes and Sports Competitors', 'P153', 'Athletes and sports competitors participate in organized, officiated sports events to entertain spectators.', '272021', 43740.00, 0.00, 16500, 3600),
(27, 10, 5, 5, 'Athletic Trainers', 'P200', 'Athletic trainers specialize in preventing, diagnosing, and treating muscle and bone injuries and illnesses. They work with people of all ages and all skill levels, from young children to soldiers and professional athletes.', '299091', 41600.00, 0.00, 18200, 5500),
(28, 5, 5, 5, 'Atmospheric Scientists, Including Meteorologists', 'P005', 'Atmospheric scientists study weather, climate, and other aspects of the atmosphere. They develop reports and forecasts from their analysis of weather and climate data.', '192021', 87780.00, 4.22, 9500, 1000),
(29, 10, 5, 7, 'Audiologists', 'P011', 'Audiologists diagnose and treat a patient’s hearing and balance problems using advanced technology and procedures.', '291181', 66660.00, 32.05, 13000, 4800),
(30, 20, 5, 2, 'Automotive Body and Glass Repairers', 'P282', 'Automotive body and glass repairers restore, refinish, and replace vehicle bodies and frames, windshields, and window glass.', '493021', 37580.00, 18.07, 170900, 32700),
(31, 20, 5, 2, 'Automotive Service Technicians and Mechanics', 'P283', 'Automotive service technicians and mechanics, often called service technicians or service techs, inspect, maintain, and repair cars and light trucks.', '493023', 35790.00, 17.21, 723400, 124800),
(32, 21, 5, 1, 'Bakers', 'P294', 'Bakers mix and bake ingredients according to recipes to make a variety of breads, pastries, and other baked goods.', '513011', 23450.00, 11.27, 149800, 3500),
(33, 15, 5, 9, 'Barbers, Hairdressers, and Cosmetologists', 'P229', 'Barbers, hairdressers, and cosmetologists provide hair styling and beauty services.', '395011', 22500.00, 10.82, 712200, 100900),
(34, 13, 5, 1, 'Bartenders', 'P220', 'Bartenders mix and serve drinks to customers directly or through wait staff.', '353011', 18680.00, 8.98, 503200, 45500),
(35, 17, 5, 2, 'Bill and Account Collectors', 'P246', 'Bill and account collectors, sometimes called collectors, try to recover payment on overdue bills. They negotiate repayment plans with debtors and help them find solutions to make paying their overdue bills easier.', '433011', 31310.00, 15.05, 401700, 57200),
(36, 5, 5, 7, 'Biochemists and Biophysicists', 'P093', 'Biochemists and biophysicists study the chemical and physical principles of living things and of biological processes such as cell development, growth, and heredity.', '191021', 79390.00, 38.17, 25100, 7700),
(37, 5, 5, 5, 'Biological Technicians', 'P110', 'Biological technicians help biological and medical scientists conduct laboratory tests and experiments.', '194021', 39020.00, 18.76, 80200, 10900),
(38, 4, 5, 5, 'Biomedical Engineers', 'P071', 'Biomedical engineers analyze and design solutions to problems in biology and medicine, with the goal of improving the quality and effectiveness of patient care.', '172031', 81540.00, 3.92, 15700, 9700),
(39, 19, 5, 2, 'Boilermakers', 'P367', 'Boilermakers assemble, install, and repair boilers, closed vats, and other large vessels or containers that hold liquids and gases.', '472011', 54640.00, 26.27, 19800, 4200),
(40, 17, 5, 2, 'Bookkeeping, Accounting, and Auditing Clerks', 'P247', 'Bookkeeping, accounting, and auditing clerks produce financial records for organizations. They record financial transactions, update statements, and check financial records for accuracy.', '433031', 34030.00, 16.36, 1898300, 259000),
(41, 19, 5, 2, 'Brickmasons, Blockmasons, and Stonemasons', 'P259', 'Brickmasons, blockmasons, and stonemasons (or, simply, masons) use bricks, concrete blocks, and natural stones to build fences, walkways, walls, and other structures.', '472021', 45410.00, 21.83, 104800, 41800),
(42, 9, 5, 9, 'Broadcast and Sound Engineering Technicians', 'P166', 'Broadcast and sound engineering technicians set up, operate, and maintain the electrical equipment for radio and television broadcasts, concerts, sound recordings, and movies and in office and school buildings.', '274011', 39870.00, 19.17, 116900, 11600),
(43, 2, 5, 5, 'Budget Analysts', 'P049', 'Budget analysts help public and private institutions organize their finances. They prepare budget reports and monitor institutional spending.', '132031', 68200.00, 32.79, 62100, 6500),
(44, 22, 5, 2, 'Bus Drivers', 'P313', 'Bus drivers transport people between a variety of places including work, school, shopping, and across state borders. Some drive regular routes, and others transport passengers on chartered trips or sightseeing tours.', '533021', 29160.00, 14.02, 647200, 83000),
(45, 10, 5, 4, 'Cardiovascular Technologists and Technicians and Vascular Technologists', 'P186', 'Cardiovascular technologists and technicians and vascular technologists use imaging technology to help physicians diagnose cardiac (heart) and peripheral vascular (blood vessel) ailments in patients. They also help physicians treat problems with cardiac and vascular systems, such as blood clots.', '292031', 49410.00, 23.75, 49400, 14500),
(46, 8, 1, 5, 'Career and Technical Education Teachers', 'P134', 'Career and technical education teachers help students in middle school and high school develop career-related and technical skills. They help students explore or prepare to enter a particular occupation, such as one in auto repair, healthcare, business, or the culinary arts.', '252023', 53920.00, 0.00, 103000, 2300),
(47, 17, 5, 2, 'Cargo and Freight Agents', 'P251', 'Cargo and freight agents coordinate and facilitate incoming and outgoing shipments for transportation companies and other businesses.', '435011', 37150.00, 17.86, 82200, 24100),
(48, 19, 5, 2, 'Carpenters', 'P260', 'Carpenters construct and repair building frameworks and structures—such as stairways, doorframes, partitions, and rafters—made from wood and other materials. They also may install kitchen cabinets, siding, and drywall.', '472031', 39530.00, 0.19, 1001700, 196000),
(49, 19, 5, 1, 'Carpet Installers', 'P261', 'Carpet installers lay carpet in homes, offices, restaurants, and many other types of buildings.', '472041', 36090.00, 17.35, 47500, 4900),
(50, 4, 5, 5, 'Cartographers and Photogrammetrists', 'P068', 'Cartographers and photogrammetrists measure, analyze, and interpret geographic information to create maps and charts for political, cultural, educational, and other purposes. Cartographers are general mapmakers, and photogrammetrists are specialized mapmakers who use aerial photographs to create maps.', '171021', 54510.00, 26.21, 13800, 3100),
(51, 16, 5, 1, 'Cashiers', 'P237', 'Cashiers handle payments from customers purchasing goods and services.', '412011', 18500.00, 8.89, 3362600, 250200),
(52, 19, 5, 9, 'Cement Masons and Terrazzo Workers', 'P368', 'Cement masons pour, smooth, and finish concrete floors, sidewalks, roads, and curbs. Using a cement mixture, terrazzo workers create durable and decorative surfaces for floors and stairways.', '472051', 35530.00, 17.08, 148400, 50700),
(53, 13, 1, 2, 'Chefs and Head Cooks', 'P217', 'Chefs and head cooks oversee the daily food preparation at restaurants or other places where food is served. They direct kitchen staff and handle any food-related concerns.', '351011', 40630.00, 19.53, 100600, 800),
(54, 4, 5, 5, 'Chemical Engineers', 'P072', 'Chemical engineers apply the principles of chemistry, biology, and physics to solve problems. These problems involve the production or use of chemicals, fuel, drugs, food, and many other products. They design processes and equipment for large-scale safe and sustainable manufacturing, plan and test methods of manufacturing products and treating byproducts, and supervise production.', '172041', 90300.00, 43.42, 30200, 18001),
(55, 5, 5, 4, 'Chemical Technicians', 'P111', 'Chemical technicians use special instruments and techniques to help chemists and chemical engineers in researching, developing, and producing chemical products and processes.', '194031', 42040.00, 20.21, 61000, 4100),
(56, 5, 5, 5, 'Chemists and Materials Scientists', 'P099', 'Chemists and materials scientists study the structures, compositions, reactions, and other properties of substances. They use their knowledge to develop new and improved products, processes, and materials.', '192031', 69790.00, 33.55, 90900, 4000),
(57, 15, 5, 2, 'Childcare Workers', 'P233', 'Childcare workers care for children when parents and other family members are unavailable. They care for children’s basic needs, such as bathing and feeding. In addition, some help children prepare for kindergarten, and many help older children with homework.', '399011', 19300.00, 9.28, 1282300, 262000),
(58, 10, 5, 7, 'Chiropractors', 'P169', 'Chiropractors treat patients with health problems of the musculoskeletal system, which is made up of bones, muscles, ligaments, and tendons.', '291011', 67200.00, 32.31, 52600, 14900),
(59, 4, 5, 4, 'Civil Engineering Technicians', 'P085', 'Civil engineering technicians help civil engineers plan and design the construction of highways, bridges, utilities, and other major infrastructure projects. They also help with commercial, residential, and land development. Civil engineering technicians work under the direction of a licensed civil engineer.', '173022', 46290.00, 22.26, 79000, 9400),
(60, 4, 5, 5, 'Civil Engineers', 'P073', 'Civil engineers design and supervise large construction projects, including roads, buildings, airports, tunnels, dams, bridges, and systems for water supply and sewage treatment.', '172051', 77560.00, 37.29, 262800, 51100),
(61, 2, 5, 9, 'Claims Adjusters, Appraisers, Examiners, and Investigators', 'P042', 'Claims adjusters, appraisers, examiners, and investigators evaluate insurance claims. They decide whether an insurance company must pay a claim, and if so, how much.', '131031', 58460.00, 28.11, 290700, 7500),
(62, 9, 5, 2, 'Coaches and Scouts', 'P154', 'Coaches teach amateur and professional athletes the skills they need to succeed at their sport. Scouts look for new players, evaluating athletes’ strengths and weaknesses as possible recruits. Many coaches also scout out new talent.', '272022', 28340.00, 0.00, 242900, 71400),
(63, 1, 1, 5, 'Compensation and Benefits Managers', 'P023', 'Compensation managers plan, direct, and coordinate how and how much an organization pays its employees. Benefits managers do the same for retirement plans, health insurance, and other benefits an organization offers its employees.', '113111', 89270.00, 42.92, 31800, 900),
(64, 3, 5, 7, 'Computer and Information Research Scientists', 'P003', 'Computer and information research scientists invent and design new technology and find new uses for existing technology. They study and solve complex problems in computing for business, science, medicine, and other uses.', '151111', 100660.00, 48.39, 28200, 5300),
(65, 1, 3, 5, 'Computer and Information Systems Managers', 'P021', 'Computer and information systems managers, often called information technology managers (IT managers or IT project managers), plan, coordinate, and direct computer-related activities in an organization. They help determine the information technology goals of an organization and are responsible for implementing the appropriate computer systems to meet those goals.', '113021', 115780.00, 55.67, 307900, 55800),
(66, 4, 5, 5, 'Computer Hardware Engineers', 'P074', 'Computer hardware engineers research, design, develop, and test computer equipment such as chips, circuit boards, or routers. By solving complex problems in computer hardware, these engineers create rapid advances in computer technology.', '172061', 98810.00, 4.75, 70000, 6300),
(67, 3, 5, 5, 'Computer Programmers', 'P056', 'Computer programmers write code to create software programs. They turn the program designs created by software developers and engineers into instructions that a computer can follow.', '151131', 71380.00, 34.32, 363100, 43700),
(68, 3, 5, 3, 'Computer Support Specialists', 'P058', 'Computer support specialists provide help and advice to people and organizations using computer software or equipment. Some, called technical support specialists, support information technology (IT) employees within their organization. Others, called help-desk technicians, assist non-IT users who are having computer problems.', '151150', 46260.00, 22.24, 607100, 110000),
(69, 3, 5, 5, 'Computer Systems Analysts', 'P059', 'Computer systems analysts study an organizations current computer systems and procedures and make recommendations to management to help the organization operate more efficiently and effectively. They bring business and information technology (IT) together by understanding the needs and limitations of both.', '151121', 77740.00, 37.38, 544400, 120400),
(70, 20, 5, 8, 'Computer, ATM, and Office Machine Repairers', 'P372', 'Computer, ATM, and office machine repairers install, fix, and maintain many of the machines that businesses, households, and other consumers use.', '492011', 37280.00, 17.92, 146200, 9500),
(71, 5, 5, 5, 'Conservation Scientists and Foresters', 'P337', 'Conservation scientists and foresters manage overall land quality of forests, parks, rangeland, and other natural resources.', '191031', 57420.00, 2.76, 34900, 1700),
(72, 19, 3, 2, 'Construction and Building Inspectors', 'P274', 'Construction and building inspectors ensure that new construction, changes, or repairs comply with local and national building codes and ordinances, zoning regulations, and contract specifications.', '474011', 52360.00, 25.18, 102400, 18400),
(73, 19, 5, 2, 'Construction Equipment Operators', 'P264', 'Construction equipment operators drive, maneuver, or control the heavy machinery used to construct roads, bridges, buildings, and other structures.', '472071', 39460.00, 18.97, 404900, 94800),
(74, 19, 5, 9, 'Construction Laborers and Helpers', 'P263', 'Construction laborers and helpers do many basic tasks that require physical labor on construction sites.', '472061', 28410.00, 13.66, 1250200, 314200),
(75, 1, 3, 4, 'Construction Managers', 'P028', 'Construction managers plan, coordinate, budget, and supervise construction projects from early development to completion.', '119021', 83860.00, 40.32, 523100, 86600),
(76, 13, 4, 9, 'Cooks', 'P218', 'Cooks prepare, season, and cook a wide range of foods, such as soups, salads, entrees, and desserts.', '352011', 20260.00, 9.74, 2050800, 161800),
(77, 12, 5, 2, 'Correctional Officers', 'P212', 'Correctional officers are responsible for overseeing individuals who have been arrested and are awaiting trial or who have been sentenced to serve time in a jail, reformatory, or prison.', '333011', 39020.00, 18.76, 493100, 26000),
(78, 2, 5, 5, 'Cost Estimators', 'P043', 'Cost estimators collect and analyze data to estimate the time, money, resources, and labor required for product manufacturing, construction projects, or services. Some specialize in a particular industry or product type.', '131051', 57860.00, 27.82, 185400, 67500),
(79, 17, 5, 2, 'Couriers and Messengers', 'P360', 'Couriers and messengers transport documents and packages for individuals, businesses, institutions, and government agencies.', '435021', 24080.00, 11.58, 116200, 14600),
(80, 7, 5, 8, 'Court Reporters', 'P008', 'Court reporters attend legal proceedings and public speaking events to create word-for-word transcriptions. Some court reporters provide captioning for television and at public events.', '232091', 47700.00, 22.93, 22000, 3100),
(81, 9, 5, 2, 'Craft and Fine Artists', 'P348', 'Craft and fine artists use a variety of materials and techniques to create art for sale and exhibition. Craft artists create handmade objects, such as pottery, glassware, textiles, or other objects that are designed to be functional. Fine artists, including painters, sculptors, and illustrators, create original works of art for their aesthetic value, rather than a functional one.', '271012', 43470.00, 2.09, 56900, 3100),
(82, 8, 5, 9, 'Curators, Museum Technicians, and Conservators', 'P138', 'Curators oversee collections, such as artwork and historic items, and may conduct public service activities for an institution. Museum technicians and conservators prepare and restore objects and documents in museum collections and exhibits.', '254012', 42310.00, 20.34, 23800, 38001),
(83, 17, 5, 2, 'Customer Service Representatives', 'P249', 'Customer service representatives interact with customers on behalf of an organization. They provide information about products and services and respond to customer complaints. Some also take orders and process returns.', '434051', 30460.00, 14.64, 2187300, 338400),
(84, 9, 4, 2, 'Dancers and Choreographers', 'P156', 'Dancers and choreographers use movements to express ideas and stories in performances. There are many types of dance, such as ballet, modern dance, tap, and jazz.', '272031', 0.00, 15.97, 25600, 4600),
(85, 3, 1, 5, 'Database Administrators', 'P060', 'Database administrators use software to store and organize data, such as financial information and customer shipping records. They make sure that data are available to users and are secure from unauthorized access.', '151141', 73490.00, 35.33, 110800, 33900),
(86, 22, 5, 2, 'Delivery Truck Drivers and Driver/Sales Workers', 'P314', 'Delivery truck drivers and driver/sales workers pick up, transport, and drop off packages within a small region or urban area. Most of the time, they transport merchandise from a distribution center to businesses and households.', '533031', 27050.00, 0.13, 1262600, 167500),
(87, 16, 5, 2, 'Demonstrators and Product Promoters', 'P357', 'Demonstrators and product promoters create public interest in products, such as cosmetics, housewares, and food. They encourage people and stores to buy their products by showing the products to prospective customers and answering questions.', '419011', 23110.00, 11.11, 90100, 15800),
(88, 11, 5, 8, 'Dental Assistants', 'P207', 'Dental assistants have many tasks, ranging from patient care to record keeping, in a dental office. Their duties vary by state and by the dentist’s office where they work.', '319091', 33470.00, 16.09, 297200, 91600),
(89, 10, 5, 4, 'Dental Hygienists', 'P185', 'Dental hygienists clean teeth, examine patients for oral diseases such as gingivitis, and provide other preventative dental care. They also educate patients on ways to improve and maintain good oral health.', '292021', 68250.00, 32.81, 181800, 68500),
(90, 21, 5, 2, 'Dental Laboratory Technicians', 'P308', 'Dental laboratory technicians use impressions, or molds, of a patient’s teeth to create crowns, bridges, dentures, and other dental appliances. They work closely with dentists but have limited contact with patients.', '519081', 35140.00, 1.69, 40900, 300),
(91, 10, 5, 7, 'Dentists', 'P170', 'Dentists diagnose and treat problems with a patient’s teeth, gums, and other parts of the mouth. They provide advice and instruction on taking care of teeth and gums and on diet choices that affect oral health.', '291021', 146920.00, 70.64, 155700, 32200),
(92, 17, 5, 4, 'Desktop Publishers', 'P256', 'Desktop publishers use computer software to design page layouts for newspapers, books, brochures, and other items that will be printed or put online. They collect the text, graphics, and other materials they will need and then format them into a finished product.', '439031', 36610.00, 1.76, 22600, 3300),
(93, 10, 5, 4, 'Diagnostic Medical Sonographers', 'P187', 'Diagnostic medical sonographers use special imaging equipment that directs sound waves into a patient’s body (in a procedure commonly known as an ultrasound, sonogram, or echocardiogram) to assess and diagnose various medical conditions.', '292032', 64380.00, 30.95, 53700, 23400),
(94, 20, 5, 2, 'Diesel Service Technicians and Mechanics', 'P284', 'Diesel service technicians and mechanics inspect, repair, or overhaul buses, trucks, and anything else with a diesel engine.', '493031', 40850.00, 19.64, 242200, 35200),
(95, 10, 5, 5, 'Dietitians and Nutritionists', 'P010', 'Dietitians and nutritionists are experts in food and nutrition. They advise people on what to eat in order to lead a healthy lifestyle or achieve a specific health-related goal.', '291031', 53250.00, 2.56, 64400, 12700),
(96, 4, 5, 4, 'Drafters', 'P084', 'Drafters use software to convert the designs of engineers and architects into technical drawings and plans. Workers in production and construction use these plans to build everything from microchips to skyscrapers.', '173011', 47880.00, 23.02, 205100, 11400),
(97, 19, 5, 1, 'Drywall and Ceiling Tile Installers, and Tapers', 'P265', 'Drywall and ceiling tile installers hang wallboards to walls and ceilings inside buildings. Tapers prepare the wallboards for painting, using tape and other materials. Many workers do both installing and taping.', '472081', 38290.00, 18.41, 129600, 37300),
(98, 5, 5, 5, 'Economists', 'P006', 'Economists study the production and distribution of resources, goods, and services.', '193011', 89450.00, 0.43, 15400, 900),
(99, 9, 1, 5, 'Editors', 'P162', 'Editors plan, review, and revise content for publication.', '273041', 51470.00, 24.75, 127200, 8001),
(100, 4, 5, 4, 'Electrical and Electronic Engineering Technicians', 'P335', 'Electrical and electronic engineering technicians help engineers design and develop computers, communications equipment, medical monitoring devices, navigational equipment, and other electrical and electronic equipment. They often work in product evaluation and testing, using measuring and diagnostic devices to adjust, test, and repair equipment.', '173023', 56040.00, 26.94, 151100, 2900),
(101, 4, 5, 5, 'Electrical and Electronics Engineers', 'P075', 'Electrical engineers design, develop, test, and supervise the manufacturing of electrical equipment such as electric motors, radar and navigation systems, communications systems, and power generation equipment. Electronics engineers design and develop electronic equipment, such as broadcast and communications systems—from portable music players to global positioning systems (GPS).', '172071', 87180.00, 41.92, 294000, 17600),
(102, 20, 5, 8, 'Electrical and Electronics Installers and Repairers', 'P373', 'Electrical and electronics installers and repairers install, repair, or replace a variety of electrical equipment in telecommunications, transportation, utilities, and other industries.', '492092', 49170.00, 23.64, 141100, 3600),
(103, 19, 5, 2, 'Electricians', 'P013', 'Electricians install and maintain electrical systems in homes, businesses, and factories.', '472111', 48250.00, 2.32, 577000, 133700),
(104, 4, 5, 4, 'Electro-mechanical Technicians', 'P336', 'Electro-mechanical technicians combine knowledge of mechanical technology with knowledge of electrical and electronic circuits. They install, troubleshoot, repair, and upgrade electronic and computer-controlled mechanical systems, such as robotic assembly machines.', '173024', 49550.00, 23.82, 16400, 1001),
(105, 1, 1, 6, 'Elementary, Middle, and High School Principals', 'P030', 'Elementary, middle, and high school principals lead teachers and other members of school staff. They manage the day-to-day operations of elementary, middle, and high schools. They set goals and objectives and evaluate their school’s progress toward meeting them.', '119032', 86970.00, 0.00, 236100, 23200),
(106, 19, 5, 2, 'Elevator Installers and Repairers', 'P275', 'Elevator installers and repairers install, fix, and maintain elevators, escalators, moving walkways, and other lifts.', '474021', 70910.00, 34.09, 19900, 2300),
(107, 10, 5, 8, 'EMTs and Paramedics', 'P190', 'Emergency medical technicians (EMTs) and paramedics care for the sick or injured in emergency medical settings. People’s lives often depend on their quick reaction and competent care. EMTs and paramedics respond to emergency calls, performing medical services and transporting patients to medical facilities.', '292041', 30360.00, 1.46, 226500, 75400),
(108, 4, 5, 4, 'Environmental Engineering Technicians', 'P086', 'Environmental engineering technicians carry out the plans that environmental engineers develop. They test, operate, and, if necessary, modify equipment for preventing or cleaning up environmental pollution. They may collect samples for testing, or they may work to mitigate sources of environmental pollution.', '173025', 43390.00, 20.86, 18800, 4600),
(109, 4, 5, 5, 'Environmental Engineers', 'P076', 'Environmental engineers use the principles of engineering, soil science, biology, and chemistry to develop solutions to environmental problems. They are involved in efforts to improve recycling, waste disposal, public health, and control of water and air pollution.', '172081', 78740.00, 37.86, 51400, 11300),
(110, 5, 5, 4, 'Environmental Science and Protection Technicians', 'P114', 'Environmental science and protection technicians do laboratory and field tests to monitor the environment and investigate sources of pollution, including those affecting health. Many work under the supervision of environmental scientists and specialists, who direct their work and evaluate their results.', '194091', 41380.00, 1.99, 29600, 7000),
(111, 5, 5, 5, 'Environmental Scientists and Specialists', 'P100', 'Environmental scientists and specialists use their knowledge of the natural sciences to protect the environment. They identify problems and find solutions that minimize hazards to the health of the environment and the population.', '192041', 61700.00, 29.66, 89400, 16700),
(112, 5, 5, 6, 'Epidemiologists', 'P096', 'Epidemiologists investigate the causes of disease and other public health problems to prevent them from spreading or from happening again. They report their findings to public policy officials and to the general public.', '191041', 63010.00, 30.29, 5000, 1200),
(113, 1, 3, 2, 'Farmers, Ranchers, and Other Agricultural Managers', 'P027', 'Farmers, ranchers, and other agricultural managers run establishments that produce crops, livestock, and dairy products.', '119013', 60750.00, 29.21, 1202500, 96100),
(114, 9, 5, 2, 'Fashion Designers', 'P146', 'Fashion designers create original clothing, accessories, and footwear. They sketch designs, select fabrics and patterns, and give instructions on how to make the products they designed.', '271022', 64530.00, 31.02, 21500, 0),
(115, 9, 4, 5, 'Film and Video Editors and Camera Operators', 'P168', 'Film and video editors and camera operators record images that entertain or inform an audience. Camera operators capture a wide range of material for TV shows, motion pictures, music videos, documentaries, or news and sporting events. Editors construct the final productions from the many different images camera operators capture. They collaborate with producers and directors to create the final production.', '274031', 45490.00, 21.87, 58300, 2200),
(116, 2, 5, 5, 'Financial Analysts', 'P051', 'Financial analysts provide guidance to businesses and individuals making investment decisions. They assess the performance of stocks, bonds, and other types of investments.', '132051', 74350.00, 35.75, 236000, 54200),
(117, 17, 5, 2, 'Financial Clerks', 'P358', 'Financial clerks do administrative work for banking, insurance, and other companies. They keep records, help customers, and carry out financial transactions.', '433021', 33710.00, 16.21, 1395500, 152600),
(118, 2, 5, 5, 'Financial Examiners', 'P053', 'Financial examiners ensure compliance with laws governing financial institutions and transactions. They review balance sheets, evaluate the risk level of loans, and assess bank management.', '132061', 74940.00, 36.03, 29300, 7900),
(119, 1, 3, 5, 'Financial Managers', 'P022', 'Financial managers are responsible for the financial health of an organization. They produce financial reports, direct investment activities, and develop strategies and plans for the long-term financial goals of their organization.', '113031', 103910.00, 49.96, 527100, 46300),
(120, 12, 3, 2, 'Fire Inspectors and Investigators', 'P352', 'Fire inspectors visit and inspect buildings and other structures to search for fire hazards and to ensure that fire codes are met. Fire investigators determine the origin and cause of fires by searching the surrounding scene and collecting evidence.', '332021', 52230.00, 25.11, 13600, 1200),
(121, 12, 5, 8, 'Firefighters', 'P211', 'Firefighters protect the public by responding to fires and other emergencies. They are frequently the first emergency personnel on the scene of an accident.', '332011', 45250.00, 21.76, 310400, 26600),
(122, 18, 5, 1, 'Fishers and Related Fishing Workers', 'P258', 'Fishers and related fishing workers catch and trap various types of marine life. The fish they catch are for human food, animal feed, bait, and other uses.', '453011', 25590.00, 1.23, 32000, 2000),
(123, 15, 5, 2, 'Fitness Trainers and Instructors', 'P235', 'Fitness trainers and instructors lead, instruct, and motivate individuals or groups in exercise activities, including cardiovascular exercise (exercises for the heart and blood system), strength training, and stretching. They work with people of all ages and skill levels.', '399031', 31090.00, 14.95, 251400, 60400),
(124, 22, 5, 2, 'Flight Attendants', 'P232', 'Flight attendants provide personal services to ensure the safety and comfort of airline passengers.', '532031', 37740.00, 0.00, 90500, 200),
(125, 9, 5, 2, 'Floral Designers', 'P147', 'Floral designers, also called florists, cut and arrange live, dried, or silk flowers and greenery to make decorative displays. They also help customers select flowers, containers, ribbons, and other accessories.', '271023', 23610.00, 11.35, 66500, 6200),
(126, 13, 5, 1, 'Food and Beverage Serving and Related Workers', 'P221', 'Food and beverage serving and related workers perform a variety of customer service, food preparation, and cleaning duties in full-service restaurants, casual dining eateries, and other eating and drinking places.', '353021', 18130.00, 8.72, 4110400, 491600),
(127, 13, 5, 1, 'Food Preparation Workers', 'P219', 'Food preparation workers perform many routine tasks under the guidance of cooks or food supervisors. They prepare cold foods, slice meat, peel and cut vegetables, brew coffee or tea, and do many other tasks.', '352021', 19100.00, 9.18, 813700, 84100),
(128, 21, 5, 1, 'Food Processing Occupations', 'P295', 'Food processing occupations include butchers and meat cutters; meat, poultry, and fish cutters and trimmers; and operators and tenders of roasting, baking, and drying machinery. These workers cut, trim, or otherwise process food items, such as meat, or nonfood items, such as tobacco, for retail sale.', '513021', 23950.00, 11.51, 311300, 37400),
(129, 21, 2, 2, 'Food Processing Operators', 'P381', 'Food processing operators include food batchmakers and food cooking machine operators and tenders. These workers may set up, operate, and tend cooking equipment that mixes, blends, cooks, or otherwise processes ingredients used to manufacture food products.', '513092', 24250.00, 11.66, 131000, 2300),
(130, 1, 1, 2, 'Food Service Managers', 'P033', 'Food service managers are responsible for the daily operations of restaurants and other establishments that prepare and serve food and beverages to customers. Managers ensure that customers are satisfied with their dining experience.', '119051', 48130.00, 23.14, 320600, 10600),
(131, 5, 5, 5, 'Forensic Science Technicians', 'P115', 'Forensic science technicians help investigate crimes by collecting and analyzing physical evidence. Most technicians specialize in either crime scene investigation or laboratory analysis.', '194092', 51570.00, 24.79, 13000, 2400),
(132, 5, 5, 4, 'Forest and Conservation Technicians', 'P343', 'Forest and conservation technicians measure and improve the quality of forests, rangeland, and other natural areas.', '194093', 33390.00, 16.05, 36500, 400),
(133, 18, 5, 2, 'Forest and Conservation Workers', 'P365', 'Forest and conservation workers measure and improve the quality of forests. Under the supervision of foresters and forest and conservation technicians, they help to develop, maintain, and protect forests.', '454011', 23900.00, 11.49, 13700, 1001),
(134, 15, 5, 4, 'Funeral Directors', 'P001', 'Funeral directors, also called morticians and undertakers, manage funeral homes and arrange the details of a funeral.', '394831', 54330.00, 26.12, 29300, 5300),
(135, 1, 4, 9, 'Gaming Services Occupations', 'P228', 'Gaming services workers serve customers in gambling establishments, such as casinos or racetracks. Some workers tend slot machines or deal cards. Others take bets or pay out winnings. Still others supervise gaming workers and operations.', '119071', 20260.00, 9.74, 177100, 22900),
(136, 20, 5, 2, 'General Maintenance and Repair Workers', 'P289', 'General maintenance and repair workers maintain and repair machines, mechanical equipment, and buildings. They work on plumbing, electrical, and air-conditioning and heating systems.', '499071', 34730.00, 1.67, 1289000, 142000),
(137, 17, 5, 2, 'General Office Clerks', 'P364', 'General office clerks do a broad range of administrative tasks, including answering telephones, typing or word processing, and filing. However, tasks vary widely in different jobs.', '439061', 26610.00, 12.79, 2950700, 489500),
(138, 5, 5, 5, 'Geographers', 'P340', 'Geographers study the earth and its land, features, and inhabitants. They also examine phenomena such as political or cultural structures as they relate to geography. They study the physical or human geographic characteristics or both of a region, ranging in scale from local to global.', '193092', 72800.00, 0.35, 1600, 600),
(139, 5, 5, 4, 'Geological and Petroleum Technicians', 'P112', 'Geological and petroleum technicians provide support to scientists and engineers in exploring and extracting natural resources, such as minerals, oil, and natural gas.', '194041', 54020.00, 25.97, 14400, 2100),
(140, 5, 5, 5, 'Geoscientists', 'P101', 'Geoscientists study the physical aspects of the Earth, such as its composition, structure, and processes, to learn about its past, present, and future.', '192042', 82500.00, 39.66, 33800, 7100),
(141, 19, 5, 2, 'Glaziers', 'P266', 'Glaziers install glass in windows, skylights, storefronts, and display cases to create distinctive designs or reduce the need for artificial lighting.', '472121', 36640.00, 17.61, 41900, 17700),
(142, 9, 5, 5, 'Graphic Designers', 'P148', 'Graphic designers create visual concepts, by hand or using computer software, to communicate ideas that inspire, inform, or captivate consumers. They help to make an organization recognizable by selecting color, images, or logo designs that represent a particular idea or identity to be used in advertising and promotions.', '271024', 43500.00, 20.92, 279200, 37300),
(143, 14, 5, 9, 'Grounds Maintenance Workers', 'P226', 'Grounds maintenance workers provide a pleasant outdoor environment by ensuring that the grounds of houses, businesses, and parks are attractive, orderly, and healthy.', '371012', 23740.00, 11.41, 1249700, 254600),
(144, 22, 5, 1, 'Hand Laborers and Material Movers', 'P322', 'Hand laborers and material movers transport objects without using machines. Some workers move freight, stock, or other materials around storage facilities; others clean vehicles; some pick up unwanted household goods; and still others pack materials for moving.', '537061', 22560.00, 10.85, 3315400, 465500),
(145, 19, 5, 2, 'Hazardous Materials Removal Workers', 'P276', 'Hazardous materials (hazmat) removal workers identify and dispose of asbestos, radioactive and nuclear waste, arsenic, lead, and other hazardous materials. They also clean up materials that are flammable, corrosive, reactive, or toxic.', '474041', 37600.00, 18.08, 38100, 8800),
(146, 4, 5, 5, 'Health and Safety Engineers', 'P333', 'Health and safety engineers develop procedures and design systems to keep people from getting sick or injured and to keep property from being damaged. They combine knowledge of health or safety and of systems engineering to make sure that chemicals, machinery, software, furniture, and other products are not going to cause harm to people or buildings.', '172111', 75430.00, 36.26, 23700, 3100),
(147, 6, 5, 5, 'Health Educators', 'P007', 'Health educators teach people about behaviors that promote wellness. They develop programs and materials to encourage people to make healthy decisions.', '211091', 45830.00, 22.03, 63400, 23200),
(148, 20, 5, 8, 'Heating, Air Conditioning, and Refrigeration Mechanics and Installers', 'P287', 'Heating, air conditioning, and refrigeration mechanics and installers—often referred to as HVACR technicians—work on heating, ventilation, cooling, and refrigeration systems that control the air quality in many types of buildings.', '499021', 42530.00, 20.45, 267800, 90300),
(149, 22, 1, 2, 'Heavy and Tractor-trailer Truck Drivers', 'P315', 'Heavy and tractor-trailer truck drivers transport goods from one location to another. Most tractor-trailer drivers are long-haul drivers and operate trucks with a capacity of at least 26,001 pounds per gross vehicle weight (GVW). They deliver goods over intercity routes, sometimes spanning several states.', '533032', 37770.00, 18.16, 1604800, 330100),
(150, 20, 5, 2, 'Heavy Vehicle and Mobile Equipment Service Technicians', 'P285', 'Heavy vehicle and mobile equipment service technicians inspect, maintain, and repair vehicles and machinery used in construction, farming, rail transportation, and other industries.', '493041', 42630.00, 2.05, 179200, 28200),
(151, 8, 5, 5, 'High School Teachers', 'P392', 'High school teachers help prepare students for life after graduation. They teach academic lessons and various skills that students will need to attend college and to enter the job market.', '252031', 53230.00, 0.00, 1037600, 71900),
(152, 5, 5, 6, 'Historians', 'P341', 'Historians research, analyze, interpret, and present the past by studying a variety of historical documents and sources.', '193093', 53520.00, 25.73, 4000, 700),
(153, 20, 5, 2, 'Home Appliance Repairers', 'P014', 'Home appliance repairers install and repair household appliances, such as refrigerators, microwaves, and washer and dryers.', '499031', 34730.00, 1.67, 47700, 3100),
(154, 20, 5, 8, 'Home Entertainment Equipment Installers and Repairers', 'P281', 'Home entertainment equipment installers and repairers set up and fix household audio and video equipment, such as televisions, stereo components, and home theater systems.', '492097', 32940.00, 15.84, 36800, 5100),
(155, 11, 5, 1, 'Home Health and Personal Care Aides', 'P201', 'Home health and personal care aides help people who are disabled, chronically ill, or cognitively impaired. They also help older adults who may need assistance. They help with activities such as bathing and dressing, and they provide services such as light housekeeping. In some states, home health aides may be able to give a client medication or check the client’s vital signs under the direction of a nurse or other healthcare practitioner.', '311011', 20170.00, 0.97, 1878700, 1313200),
(156, 1, 1, 5, 'Human Resources Managers', 'P025', 'Human resources managers plan, direct, and coordinate the administrative functions of an organization. They oversee the recruiting, interviewing, and hiring of new staff; consult with top executives on strategic planning; and serve as a link between an organization’s management and its employees.', '113121', 99180.00, 47.68, 71800, 9300),
(157, 2, 5, 5, 'Human Resources Specialists', 'P044', 'Human resources specialists recruit, screen, interview, and place workers. They also may handle human resources work in a variety of other areas, such as employee relations, payroll and benefits, and training.', '131078', 52690.00, 25.33, 442200, 90700),
(158, 5, 5, 6, 'Hydrologists', 'P102', 'Hydrologists study water and the water cycle. They use their expertise to solve problems in the areas of water quality or availability.', '192043', 75690.00, 36.39, 7600, 1400),
(159, 9, 5, 5, 'Industrial Designers', 'P145', 'Industrial designers develop the concepts for manufactured products, such as cars, home appliances, and toys. They combine art, business, and engineering to make products that people use every day.', '271021', 58230.00, 27.99, 40800, 4300),
(160, 4, 5, 4, 'Industrial Engineering Technicians', 'P087', 'Industrial engineering technicians plan ways to effectively use personnel, materials, and machines in factories, stores, hospitals, repair shops, and offices. As assistants to industrial engineers, they help prepare machinery and equipment layouts, plan workflows, conduct statistical production studies, and analyze production costs.', '173026', 48210.00, 23.18, 62500, 2600),
(161, 4, 5, 5, 'Industrial Engineers', 'P077', 'Industrial engineers find ways to eliminate wastefulness in production processes. They devise efficient ways to use workers, machines, materials, information, and energy to make a product or provide a service.', '172112', 76100.00, 36.59, 203900, 13100),
(162, 20, 5, 2, 'Industrial Machinery Mechanics and Maintenance Workers', 'P288', 'Industrial machinery mechanics and maintenance workers maintain and repair factory equipment and other industrial machinery, such as conveying systems, production machinery, and packaging equipment.', '499041', 44160.00, 21.23, 357000, 66400),
(163, 1, 1, 5, 'Industrial Production Managers', 'P026', 'Industrial production managers oversee the daily operations of manufacturing and related plants. They coordinate, plan, and direct the activities used to create a wide range of goods, such as cars, computer equipment, or paper products.', '113051', 87160.00, 41.91, 150300, 13700),
(164, 17, 5, 9, 'Information Clerks', 'P359', 'Information clerks provide administrative and clerical support in a variety of settings. They help maintain records, collect data and information, and respond to customers’ questions or concerns.', '434021', 29990.00, 14.42, 1605300, 108900);
INSERT INTO `occupations` (`Id`, `IndustryId`, `WorkExperienceId`, `EducationLevelId`, `Name`, `Code`, `Description`, `SocCode`, `MedianPayAnnual`, `MedianPayHourly`, `NumberOfJobs`, `EmploymentOpenings`) VALUES
(165, 3, 1, 5, 'Information Security Analysts, Web Developers, and Computer Network Architects', 'P062', 'Information security analysts, web developers, and computer network architects all use information technology (IT) to advance their organization’s goals. Security analysts ensure a firm’s information stays safe from cyberattacks. Web developers create websites to help firms have a public face. Computer network architects create the internal networks all workers within organizations use.', '151179', 75660.00, 36.37, 302300, 65700),
(166, 8, 3, 6, 'Instructional Coordinators', 'P141', 'Instructional coordinators oversee school districts’ curriculums and teaching standards. They work with teachers and school administrators to implement new teaching techniques to improve the quality of education.', '259031', 58830.00, 28.28, 139700, 27300),
(167, 19, 5, 9, 'Insulation Workers', 'P267', 'Insulation workers install and replace the materials used to insulate buildings and their mechanical systems to help control and maintain temperature.', '472131', 35110.00, 16.88, 51400, 14400),
(168, 16, 5, 2, 'Insurance Sales Agents', 'P240', 'Insurance sales agents help insurance companies generate new business by contacting potential customers and selling one or more types of insurance. An agent explains various insurance policies and helps clients choose plans that suit them.', '413021', 46770.00, 22.48, 411500, 90200),
(169, 2, 5, 5, 'Insurance Underwriters', 'P002', 'Insurance underwriters decide whether to provide insurance and under what terms. They evaluate insurance applications and determine coverage amounts and premiums.', '132053', 59290.00, 28.51, 101800, 6000),
(170, 9, 5, 5, 'Interior Designers', 'P149', 'Interior designers make interior spaces functional, safe, and beautiful for almost every type of building: offices, homes, airport terminals, shopping malls, and restaurants. They select and specify colors, finishes, fabrics, furniture, flooring and wallcoverings, lighting, and other materials to create useful and stylish interiors for buildings.', '271025', 46280.00, 22.25, 56500, 10900),
(171, 9, 5, 5, 'Interpreters and Translators', 'P165', 'Interpreters and translators convert information from one language to another. Interpreters work in spoken or sign language, translators in written language.', '273091', 43300.00, 20.82, 58400, 24600),
(172, 14, 5, 1, 'Janitors and Building Cleaners', 'P223', 'Janitors and building cleaners keep many types of buildings clean, orderly, and in good condition.', '372011', 22210.00, 10.68, 2310400, 246400),
(173, 21, 5, 2, 'Jewelers and Precious Stone and Metal Workers', 'P307', 'Jewelers and precious stone and metal workers design, manufacture, and sell jewelry. They also adjust, repair, and appraise gems and jewelry.', '519071', 35170.00, 16.91, 39200, 2000),
(174, 7, 4, 9, 'Judges, Mediators, and Hearing Officers', 'P127', 'Judges, mediators, and hearing officers apply the law to court cases and oversee the legal process in courts. They also resolve administrative disputes and facilitate negotiations between opposing parties.', '231021', 91880.00, 44.17, 62700, 4600),
(175, 8, 5, 5, 'Kindergarten and Elementary School Teachers', 'P132', 'Kindergarten and elementary school teachers prepare younger students for future schooling by teaching them the basics of subjects such as math and reading.', '252012', 51380.00, 0.00, 1655800, 281500),
(176, 4, 5, 5, 'Landscape Architects', 'P067', 'Landscape architects plan and design land areas for parks, recreational facilities, highways, airports, and other properties. Projects include subdivisions and commercial, industrial, and residential sites.', '171012', 62090.00, 29.85, 21600, 3500),
(177, 21, 5, 1, 'Laundry and Dry-cleaning Workers', 'P299', 'Laundry and dry-cleaning workers clean clothing, linens, drapes, and other articles, using washing, drying, and dry-cleaning machines. They also may clean leather, suede, furs, and rugs.', '516011', 19540.00, 0.94, 225200, 1600),
(178, 7, 5, 7, 'Lawyers', 'P126', 'Lawyers advise and represent individuals, businesses, or government agencies on legal issues or disputes.', '231011', 112760.00, 54.21, 728200, 73600),
(179, 1, 1, 5, 'Legislators', 'P041', 'Legislators are elected officials who develop laws for the federal government, or for local or state governments.', '111031', 19260.00, 0.00, 67700, 2001),
(180, 8, 5, 6, 'Librarians', 'P139', 'Librarians help people find information from many sources. They maintain library collections and do other work as needed to keep the library running.', '254021', 54500.00, 2.62, 156100, 10800),
(181, 8, 5, 9, 'Library Technicians and Assistants', 'P140', 'Library technicians and assistants help librarians acquire, prepare, and organize materials. They also do other tasks that are needed to run a library.', '254031', 26330.00, 12.66, 231500, 22100),
(182, 10, 5, 8, 'Licensed Practical and Licensed Vocational Nurses', 'P195', 'Licensed practical and licensed vocational nurses (known as LPNs or LVNs, depending on the state in which they work) provide basic nursing care. They work under the direction of registered nurses and doctors.', '292061', 40380.00, 19.42, 752300, 168500),
(183, 20, 5, 2, 'Line Installers and Repairers', 'P291', 'Line installers and repairers install or repair electrical power systems and telecommunications cables, including fiber optics.', '499051', 54290.00, 26.11, 269100, 36200),
(184, 2, 5, 2, 'Loan Officers', 'P054', 'Loan officers evaluate, authorize, or recommend approval of loan applications for people and businesses.', '132072', 56490.00, 27.16, 289400, 41000),
(185, 1, 1, 2, 'Lodging Managers', 'P034', 'Lodging managers make sure that guests on vacation or business travel have a pleasant experience, while also ensuring that the establishments are run efficiently and profitably.', '119081', 46880.00, 22.54, 51400, 4300),
(186, 18, 5, 2, 'Logging Workers', 'P366', 'Logging workers harvest thousands of acres of forests each year. The timber they harvest provides the raw material for countless consumer and industrial products.', '454021', 32870.00, 1.58, 53200, 2300),
(187, 2, 1, 5, 'Logisticians', 'P329', 'Logisticians analyze and coordinate an organization’s supply chain—the system that moves a product from supplier to consumer. They manage the entire life cycle of a product, which includes how a product is acquired, distributed, allocated, and delivered.', '131081', 70800.00, 34.04, 108900, 27800),
(188, 21, 5, 2, 'Machinists and Tool and Die Makers', 'P297', 'Machinists and tool and die makers set up and operate a variety of computer-controlled or mechanically-controlled machine tools to produce precision metal parts, instruments, and tools.', '514041', 39910.00, 19.19, 438100, 29900),
(189, 14, 5, 1, 'Maids and Housekeeping Cleaners', 'P224', 'Maids and housekeeping cleaners do general cleaning tasks, including making beds and vacuuming halls, in private homes and commercial establishments.', '372012', 19300.00, 9.28, 1427300, 111600),
(190, 2, 1, 5, 'Management Analysts', 'P045', 'Management analysts, often called management consultants, propose ways to improve the efficiency of an organization. They advise managers on how to make organizations more profitable through reduced costs and increased revenues.', '131111', 78160.00, 37.58, 718800, 157200),
(191, 15, 5, 8, 'Manicurists and Pedicurists', 'P230', 'Manicurists and pedicurists clean, shape, and beautify fingernails and toenails.', '395092', 19650.00, 9.45, 81700, 13600),
(192, 4, 5, 5, 'Marine Engineers and Naval Architects', 'P078', 'Marine engineers and naval architects design, build, and maintain ships from aircraft carriers to submarines, from sailboats to tankers. Marine engineers work on the mechanical systems, such as propulsion and steering. Naval architects work on the basic design, including the form and stability of hulls.', '172121', 79920.00, 38.42, 5900, 1000),
