(290, 16, 5, 5, 'Securities, Commodities, and Financial Services Sales Agents', 'P241', 'Securities, commodities, and financial services sales agents connect buyers and sellers in financial markets. They sell securities to individuals, advise companies in search of investors, and conduct trades.', '413031', 70190.00, 33.75, 312200, 47500),
(291, 12, 5, 2, 'Security Guards and Gaming Surveillance Officers', 'P216', 'Security guards and gaming surveillance officers patrol and inspect property against fire, theft, vandalism, terrorism, and illegal activity. They monitor people and buildings in an effort to prevent crime.', '339031', 24380.00, 11.72, 1090600, 200200),
(292, 8, 1, 2, 'Self-enrichment Teachers', 'P347', 'Self-enrichment teachers instruct in a variety of subjects that students take for fun or self-improvement, such as music and foreign languages. These classes generally do not lead to a degree or certification, and students take them voluntarily to learn new skills or gain understanding of a subject.', '253021', 36340.00, 17.47, 252800, 52800),
(293, 21, 5, 4, 'Semiconductor Processors', 'P015', 'Semiconductor processors oversee the manufacturing of electronic semiconductors, which are commonly known as integrated circuits or microchips. These microchips are found in all electronic devices—including cell phones, cars, and laptops—and are an important part of modern life.', '519141', 33130.00, 15.93, 21100, 3800),
(294, 9, 5, 5, 'Set and Exhibit Designers', 'P150', 'Set designers create sets for movie, television, theater, and other productions. They analyze scripts or other research documents to determine how many sets will be needed and how each set can best support the story. Exhibit designers create spaces to display products, art, or artifacts.', '271027', 46680.00, 22.44, 11700, 1200),
(295, 21, 5, 1, 'Sewers and Tailors', 'P383', 'Sewers and tailors sew, join, reinforce, or finish clothing or other items. They may create new pieces of clothing from patterns and designs or alter existing garments to fit customers better.', '516051', 25850.00, 12.43, 57500, 4001),
(296, 19, 5, 2, 'Sheet Metal Workers', 'P369', 'Sheet metal workers fabricate or install products that are made from thin metal sheets, such as ducts used for heating and air conditioning.', '472211', 41710.00, 20.05, 136100, 23900),
(297, 15, 5, 8, 'Skincare Specialists', 'P231', 'Skincare specialists cleanse and beautify the face and body to enhance a person’s appearance.', '395094', 28920.00, 1.39, 47600, 11700),
(298, 21, 5, 1, 'Slaughterers and Meat Packers', 'P380', 'Slaughterers and meat packers kill and clean animals, divide carcasses into manageable sections, and grind or otherwise prepare and pack products, such as boxed beef, for shipping to distribution centers.', '513023', 23380.00, 11.24, 89100, 7400),
(299, 20, 5, 2, 'Small Engine Mechanics', 'P286', 'Small engine mechanics inspect, service, and repair motorized power equipment. Mechanics often specialize in one type of equipment, such as motorcycles, motorboats, or outdoor power equipment.', '493051', 31790.00, 15.29, 68800, 14300),
(300, 1, 1, 5, 'Social and Community Service Managers', 'P038', 'Social and community service managers coordinate and supervise social service programs and community organizations. They direct and lead staff who provide services to the public.', '119151', 57950.00, 27.86, 134100, 35800),
(301, 6, 5, 2, 'Social and Human Service Assistants', 'P125', 'Social and human service assistants help people get through difficult times or get additional support. They help other workers, such as social workers, and they help clients find benefits or community services.', '211093', 28200.00, 13.56, 384200, 106000),
(302, 6, 5, 9, 'Social Workers', 'P121', 'There are two main types of social workers: direct-service social workers, who help people solve and cope with problems in their everyday lives, and clinical social workers, who diagnose and treat mental, behavioral, and emotional issues.', '211021', 42480.00, 20.42, 650500, 161200),
(303, 5, 5, 6, 'Sociologists', 'P106', 'Sociologists study society and social behavior by examining the groups, cultures, organizations, social institutions, and processes that people develop.', '193041', 72360.00, 34.79, 4000, 700),
(304, 3, 5, 5, 'Software Developers', 'P057', 'Software developers are the creative minds behind computer programs. Some develop the applications that allow people to do specific tasks on a computer or other device. Others develop the underlying systems that run the devices or control networks.', '151132', 90530.00, 43.52, 913100, 270900),
(305, 8, 5, 5, 'Special Education Teachers', 'P135', 'Special education teachers work with students who have a wide range of learning, mental, emotional and physical disabilities. With students who have mild or moderate disabilities, they ensure that lessons and teaching strategies are modified to meet the students’ needs. With students who have severe disabilities, they teach the students independent living skills and basic literacy, communication, and math.', '252041', 53220.00, 0.00, 459600, 77400),
(306, 10, 5, 6, 'Speech-Language Pathologists', 'P182', 'Speech-language pathologists diagnose and treat communication and swallowing disorders in patients.', '291127', 66920.00, 32.17, 123200, 28800),
(307, 21, 5, 2, 'Stationary Engineers and Boiler Operators', 'P303', 'Stationary engineers and boiler operators control stationary engines, boilers, or other mechanical equipment to provide utilities for buildings or for industrial purposes.', '518021', 52140.00, 25.07, 37600, 2300),
(308, 3, 5, 6, 'Statisticians', 'P065', 'Statisticians use mathematical techniques to analyze and interpret data and draw conclusions.', '152041', 72830.00, 35.02, 25100, 3500),
(309, 19, 5, 2, 'Structural Iron and Steel Workers', 'P273', 'Structural iron and steel workers install iron or steel beams, girders, and columns to form buildings, bridges, and other structures. They are often referred to as ironworkers.', '472221', 44540.00, 21.42, 59800, 13100),
(310, 6, 5, 2, 'Substance Abuse and Behavioral Disorder Counselors', 'P116', 'Substance abuse and behavioral disorder counselors advise people who have alcoholism or other types of addiction, eating disorders, or other behavioral problems. They provide treatment and support to help the client recover from addiction or modify problem behaviors.', '211011', 38120.00, 18.33, 85500, 23400),
(311, 22, 5, 2, 'Subway and Streetcar Operators', 'P319', 'Subway and streetcar operators transport passengers in urban and suburban areas. The vehicles they drive travel underground, on above-ground and elevated tracks, on streets, or on separate tracks.', '534041', 56880.00, 27.35, 6500, 600),
(312, 10, 5, 8, 'Surgical Technologists', 'P193', 'Surgical technologists, also called operating room technicians, assist in surgical operations. They prepare operating rooms, arrange equipment, and help doctors and nurses during surgeries.', '292055', 39920.00, 19.19, 93600, 17700),
(313, 5, 5, 5, 'Survey Researchers', 'P104', 'Survey researchers design or conduct surveys and analyze survey data.', '193022', 36050.00, 17.33, 19600, 4700),
(314, 4, 5, 2, 'Surveying and Mapping Technicians', 'P089', 'Surveying and mapping technicians assist surveyors and cartographers in collecting data and making maps of the earth’s surface. Surveying technicians visit sites to take measurements of the land. Mapping technicians use geographic data to create maps.', '173031', 37900.00, 18.22, 56900, 9000),
(315, 4, 5, 5, 'Surveyors', 'P069', 'Surveyors establish official land, airspace, and water boundaries. Surveyors work with civil engineers, landscape architects, and urban and regional planners to develop comprehensive design documents.', '171022', 54880.00, 26.39, 51200, 13000),
(316, 2, 5, 5, 'Tax Examiners and Collectors, and Revenue Agents', 'P055', 'Tax examiners and collectors, and revenue agents ensure that governments get their tax money from businesses and citizens. They review tax returns, conduct audits, identify taxes owed, and collect overdue tax payments.', '132081', 49360.00, 23.73, 74500, 5500),
(317, 22, 5, 1, 'Taxi Drivers and Chauffeurs', 'P316', 'Taxi drivers and chauffeurs drive people to and from the places they need to go, such as homes, workplaces, airports, and shopping centers. They must know their way around a city to take both residents and visitors to their destinations.', '533041', 22440.00, 10.79, 239900, 47000),
(318, 8, 5, 2, 'Teacher Assistants', 'P142', 'Teacher assistants work under a teacher’s supervision to give students additional attention and instruction.', '259041', 23220.00, 0.00, 1288300, 191100),
(319, 9, 1, 5, 'Technical Writers', 'P163', 'Technical writers, also called technical communicators, produce instruction manuals and other supporting documents to communicate complex and technical information more easily. They also develop, gather, and disseminate technical information among customers, designers, and manufacturers.', '273042', 63280.00, 30.42, 49500, 8500),
(320, 20, 5, 8, 'Telecommunications Equipment Installers and Repairers Except Line Installers', 'P279', 'Telecommunications equipment installers and repairers, also known as telecom technicians, set up and maintain devices or equipment that carry communications signals, connect to telephone lines, or access the Internet.', '492022', 54710.00, 2.63, 194900, 28400),
(321, 17, 5, 2, 'Tellers', 'P248', 'Tellers are responsible for accurately processing routine transactions at a bank. These transactions include cashing checks, depositing money, and collecting loan payments.', '433071', 24100.00, 11.59, 560000, 7300),
(322, 19, 5, 1, 'Tile and Marble Setters', 'P262', 'Tile and marble setters apply hard tile, marble, and wood tiles to walls, floors, and other surfaces.', '472044', 38110.00, 18.32, 58700, 14900),
(323, 1, 4, 9, 'Top Executives', 'P039', 'Top executives devise strategies and policies to ensure that an organization meets its goals. They plan, direct, and coordinate operational activities of companies and public or private-sector organizations.', '111011', 101250.00, 48.68, 2136900, 97000),
(324, 22, 4, 2, 'Train Engineers and Operators', 'P317', 'Train engineers and train operators ensure that freight trains and passenger trains stay on time and travel safely. Train engineers drive trains. Train operators work the brakes, signals, or switches.', '534011', 46100.00, 22.17, 67100, 500),
(325, 1, 1, 5, 'Training and Development Managers', 'P024', 'Training and development managers plan, direct, and coordinate programs to enhance the knowledge and skills of an organization’s employees. They also oversee a staff of training and development specialists.', '113131', 89170.00, 42.87, 29800, 4300),
(326, 16, 5, 2, 'Travel Agents', 'P012', 'Travel agents sell transportation, lodging, and admission to entertainment activities to individuals and groups who are planning trips. They offer advice on destinations, plan trip itineraries, and make travel arrangements for clients.', '413041', 31870.00, 15.32, 82800, 8300),
(327, 9, 5, 2, 'Umpires, Referees, and Other Sports Officials', 'P155', 'Umpires, referees, and other sports officials preside over competitive athletic or sporting events. They detect infractions and decide penalties according to the rules of the game.', '272023', 22840.00, 0.00, 19500, 3900),
(328, 21, 5, 2, 'Upholsterers', 'P384', 'Upholsterers make, replace, and repair coverings on furniture and in vehicles.', '516093', 29960.00, 1.44, 46900, 20001),
(329, 5, 5, 6, 'Urban and Regional Planners', 'P107', 'Urban and regional planners develop plans and programs for the use of land. They use planning to create communities, accommodate growth, or revitalize physical facilities in towns, cities, counties, and metropolitan areas.', '193051', 63040.00, 30.31, 40300, 6500),
(330, 10, 5, 7, 'Veterinarians', 'P183', 'Veterinarians care for the health of animals. They diagnose, treat, or research medical conditions and diseases of pets, livestock, and animals in zoos, racetracks, and laboratories.', '291131', 82040.00, 39.44, 61400, 22000),
(331, 11, 5, 2, 'Veterinary Assistants and Laboratory Animal Caretakers', 'P210', 'Veterinary assistants and laboratory animal caretakers look after nonfarm animals in laboratories, animal hospitals, and clinics. They care for the well-being of animals by doing routine tasks under the supervision of veterinarians, scientists, or veterinary technologists or technicians.', '319096', 22040.00, 1.06, 73200, 10400);
