(332, 10, 5, 4, 'Veterinary Technologists and Technicians', 'P194', 'Veterinary technologists and technicians perform medical tests under the supervision of a licensed veterinarian to treat or to help veterinarians diagnose the illnesses and injuries of animals.', '292056', 29710.00, 14.28, 80200, 41700),
(333, 13, 5, 1, 'Waiters and Waitresses', 'P222', 'Waiters and waitresses take orders and serve food and beverages to customers in dining establishments.', '353031', 18330.00, 8.81, 2260300, 195900),
(334, 21, 5, 2, 'Water and Wastewater Treatment Plant and System Operators', 'P304', 'Water and wastewater treatment plant and system operators manage a system of machines, often through the use of control boards, to transfer or treat water or wastewater.', '518031', 40770.00, 1.96, 110700, 12900),
(335, 22, 5, 9, 'Water Transportation Occupations', 'P320', 'Workers in water transportation occupations operate and maintain ships that take cargo and people over water. These ships travel to and from foreign ports across the ocean, to domestic ports along the coasts, across the Great Lakes, and along the country’s many inland waterways.', '535011', 46610.00, 22.41, 82600, 16700),
(336, 21, 2, 2, 'Welders, Cutters, Solderers, and Brazers', 'P298', 'Welders, cutters, solderers, and brazers weld or join metal parts. They also fill holes, indentions, or seams of metal products, using hand-held welding equipment.', '514121', 35450.00, 17.04, 337300, 50700),
(337, 16, 5, 9, 'Wholesale and Manufacturing Sales Representatives', 'P242', 'Wholesale and manufacturing sales representatives sell goods for wholesalers or manufacturers to businesses, government agencies, and other organizations. They contact customers, explain product features, answer any questions that their customers may have, and negotiate prices.', '414011', 56620.00, 27.22, 1830000, 288900),
(338, 21, 5, 2, 'Woodworkers', 'P300', 'Woodworkers build a variety of products, such as cabinets and furniture, using wood.', '517011', 28010.00, 13.47, 217200, 39300),
(339, 9, 5, 5, 'Writers and Authors', 'P164', 'Writers and authors develop original written content for advertisements, books, magazines, movie and television scripts, songs, and online publications.', '273043', 55420.00, 26.64, 145900, 9500),
(340, 5, 5, 5, 'Zoologists and Wildlife Biologists', 'P095', 'Zoologists and wildlife biologists study the characteristics and habitats of animals and wildlife.', '191023', 57430.00, 27.61, 19800, 1500);
